=\"true\" height=\"500\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/6-36.jpg\" width=\"333\" /></p>\r\n\r\n<h2 id=\"tab-con-7\"><strong>Sn giay adidas n gim gi&aacute;</strong></h2>\r\n\r\n<p>C&ograve;n i vi c&aacute;c bn n c&oacute; mong mun t&igrave;m c mt &ocirc;i gi&agrave;y adidas n gi&aacute; r. Bn c&oacute; th &aacute;p dng bt k phng ph&aacute;p n&agrave;o trong 4 phng ph&aacute;p m&igrave;nh &atilde; a ra. Gi&agrave;y adidas n sale l&agrave; mt mt h&agrave;ng thng c &aacute;p dng trong c&aacute;c chng tr&igrave;nh. Ch&iacute;nh v&igrave; c im a chung mua sm, m&agrave; Adidas thng xuy&ecirc;n t chc chng tr&igrave;nh cho ph n.</p>\r\n\r\n<p style=\"text-align:center;\"><img alt=\"giay adidas\" data-lazy-src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/7-33.jpg\" data-was-processed=\"true\" height=\"333\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/7-33.jpg\" width=\"500\" /></p>\r\n\r\n<p>Va ri l&agrave; c&aacute;c mo sn gi&agrave;y adidas ch&iacute;nh h&atilde;ng gi&aacute; r m&agrave; m&igrave;nh tng hp c. Nu bn n&agrave;o c&oacute; c&aacute;ch sn gi&agrave;y Adidas sale 2018 th&igrave; ng qu&ecirc;n chia s cho mi ngi di phn b&igrave;nh lun nh&eacute;.</p>\r\n\r\n<h2><strong>C&aacute;ch v sinh v&agrave; bo qun giay adidas &uacute;ng c&aacute;ch nh mi</strong></h2>\r\n\r\n<p>Vic t&igrave;m mua mt &ocirc;i gi&agrave;y Adidas  vic s dng c thoi m&aacute;i cho nhiu chc nng kh&aacute;c nhau. Tuy nhi&ecirc;n, vic v sinh v&agrave; bo qun gi&agrave;y Adidas &uacute;ng c&aacute;ch nh mi s gi&uacute;p bn l&agrave;m tng tui th cho&nbsp;&ocirc;i gi&agrave;y v&agrave; l&agrave;m gim chi ph&iacute; sinh hot cho bn. C&ugrave;ng t&igrave;m hiu nh&eacute;!</p>\r\n\r\n<h3><strong>1. Bao l&acirc;u mi v sinh giay adidas</strong></h3>\r\n\r\n<p>Chng c&oacute; quy tc n&agrave;o quy nh thi thi gian v sinh gi&agrave;y ca m&igrave;nh, th nhng tt nht h&atilde;y t a ra nh k v sinh gi&agrave;y cho m&igrave;nh mi th&aacute;ng git gi&agrave;y mt ln nh&eacute;! B&ecirc;n cnh &oacute;, bn n&ecirc;n v sinh gi&agrave;y ca m&igrave;nh tt nht l&agrave; bng tay  gi&agrave;y kh&ocirc;ng b h hi.</p>\r\n\r\n<p style=\"text-align:center;\"><img alt=\"giay adidas\" data-lazy-src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/8-28.jpg\" data-was-processed=\"true\" height=\"281\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/8-28.jpg\" width=\"500\" /></p>\r\n\r\n<p>Tuy nhi&ecirc;n, bn cng cn da v&agrave;o mc &iacute;ch v&agrave; tn sut s dng m&agrave; c&oacute; thi gian  git gi&agrave;y hp l&yacute;. Nu gi&agrave;y ca bn thng xuy&ecirc;n s dng v&agrave; thng lm lem b&ugrave;n t th&igrave; bn n&ecirc;n git gi t 1 n 2 tun 1 ln. V&agrave; gi&agrave;y khi d&iacute;nh nc th&igrave; cn git lu&ocirc;n  tr&aacute;nh kh&ocirc;ng b m mc v&agrave; nhanh b hng. Ngo&agrave;i ra, bn cng c&oacute; th v sinh &ocirc;i gi&agrave;y ca m&igrave;nh mi ng&agrave;y bng c&aacute;ch s dng b&agrave;n chi c&oacute; l&ocirc;ng mm chi nh tr&ecirc;n b mt &ocirc;i gi&agrave;y  &aacute;nh bay bi bn nh&eacute;!</p>\r\n\r\n<h3><strong>2. C&aacute;ch v sinh v&agrave; bo qun giay adidas</strong></h3>\r\n\r\n<p>Nu &ocirc;i gi&agrave;y ca bn c&oacute; cht lng tt nh th n&agrave;o nhng nu kh&ocirc;ng bit c&aacute;ch v sinh v&agrave; bo qun th&igrave; &ocirc;i gi&agrave;y ca bn s nhanh xung cp g&acirc;y nhanh hng. V&igrave; th, bn n&ecirc;n ghi nh nhng iu sau &acirc;y nh&eacute;!</p>\r\n\r\n<p>Kh&ocirc;ng n&ecirc;n git li&ecirc;n tc sau mi ln s dng v&igrave; ch&uacute;ng s l&agrave;m gim tui th cho &ocirc;i gi&agrave;y ca bn nhanh b hng bi phi thng xuy&ecirc;n tip x&uacute;c vi nc.</p>\r\n\r\n<p>B&ecirc;n cnh &oacute;, bn kh&ocirc;ng c git gi&agrave;y bng m&aacute;y git hay m&aacute;y sy v&igrave; ch&uacute;ng s nh hng n cht lng ca &ocirc;i gi&agrave;y bn y.</p>\r\n\r\n<p>Khi git gi&agrave;y bn tuyt i kh&ocirc;ng n&ecirc;n ng&acirc;m gi&agrave;y trong nc qu&aacute; l&acirc;u hay ng&acirc;m chung vi qun &aacute;o v&igrave; s nh hng n phn keo d&iacute;nh. Nu c&oacute; th bn n&ecirc;n d&ugrave;ng v&ograve;i nc &nbsp;xt v&agrave;o gi&agrave;y s rt nhanh v&agrave; gn.</p>\r\n\r\n<p>N&ecirc;n hn ch d&ugrave;ng x&agrave; b&ocirc;ng  git gi&agrave;y tr nhng trng hp gi&agrave;y qu&aacute; bn th&ocirc;i nh&eacute;!</p>\r\n\r\n<p>V&agrave; sau khi git xong, th&igrave; h&atilde;y d&ugrave;ng giy b&aacute;o nh&eacute;t v&agrave;o b&ecirc;n trong  gi&agrave;y vn gi c form nh ban u.</p>\r\n\r\n<p>Bn n&ecirc;n nh h&atilde;y i v&agrave; th&aacute;o gi&agrave;y &uacute;ng c&aacute;ch v&agrave; khi x gi&agrave;y th&igrave; cn chnh d&acirc;y cho &uacute;ng c&aacute;ch v&igrave; nu kh&ocirc;ng gi&agrave;y ca bn s nhanh ch&oacute;ng bin dng. B&ecirc;n cnh &oacute;, th&aacute;o d&acirc;y gi&agrave;y cng cn phi &uacute;ng c&aacute;ch v&agrave; nh nh&agrave;ng  gi&agrave;y kh&ocirc;ng nhanh hng.</p>\r\n\r\n<p>Ngo&agrave;i ra, sau khi s dng gi&agrave;y bn kh&ocirc;ng n&ecirc;n  gi&agrave;y  ni c&oacute; nhit qu&aacute; cao hay qu&aacute; lnh, tt nht l&agrave; n&ecirc;n   ngn ng gi&agrave;y c&oacute; nhit  va phi.</p>\r\n\r\n<p style=\"text-align:center;\"><img alt=\"giay adidas\" data-lazy-src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/9-32.jpg\" data-was-processed=\"true\" height=\"281\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/9-32.jpg\" width=\"500\" /></p>\r\n\r\n<p><strong>C&aacute;ch v sinh gi&agrave;y Adidas &uacute;ng c&aacute;ch:</strong></p>\r\n\r\n<p><em>Bc 1:</em></p>\r\n\r\n<p>u ti&ecirc;n pha nc m c&ugrave;ng vi &iacute;t x&agrave; b&ocirc;ng v&agrave;o chic thau nh khuy u.</p>\r\n\r\n<p><em>Bc 2:</em></p>\r\n\r\n<p>Tip n, bn th&aacute;o d&acirc;y gi&agrave;y v&agrave; th&aacute;o ming l&oacute;t gi&agrave;y ra.</p>\r\n\r\n<p><em>Bc 3:</em></p>\r\n\r\n<p>Sau &oacute;, ly b&agrave;n chi c&oacute; l&ocirc;ng mm nh&uacute;ng v&agrave;o hn hp x&agrave; b&ocirc;ng ri l&agrave;m nh nh&agrave;ng l&agrave;m sch c&aacute;c vt bn c b&ecirc;n trong ln b&ecirc;n ngo&agrave;i ca &ocirc;i gi&agrave;y. B&ecirc;n cnh &oacute;, nhng ni kh&ocirc;ng tip x&uacute;c c th&igrave; bn d&ugrave;ng b&agrave;n chi &aacute;nh rng &atilde; c  ch&agrave; x&aacute;t v&agrave;o xung quanh li g&agrave; v&agrave; phn b&ecirc;n trong ca &ocirc;i gi&agrave;y.</p>\r\n\r\n<p><em>Bc 4:</em></p>\r\n\r\n<p>D&ugrave;ng nc m ra sch li &ocirc;i gi&agrave;y ri vy mnh &ocirc;i gi&agrave;y  loi b c lng nc tha c&ograve;n ng li b&ecirc;n trong. Tip n, bn d&ugrave;ng gi kh&ocirc; hay khn giy nhi v&agrave;o trong  h&uacute;t nc v&agrave; gi&uacute;p &ocirc;i gi&agrave;y kh&ocirc; t t. Nhng bn n&ecirc;n nh tr&aacute;nh &aacute;nh s&aacute;ng trc tip chiu v&agrave;o nh&eacute;!</p>\r\n\r\n<p><em>Bc 5:</em></p>\r\n\r\n<p>V phn d&acirc;y gi&agrave;y th&igrave; bn h&atilde;y git x&agrave; b&ocirc;ng ri git sch li phi kh&ocirc;. Nu li th&igrave; bn cng c&oacute; th git bng m&aacute;y git nhng trc &oacute; h&atilde;y cho d&acirc;y gi&agrave;y v&agrave;o t&uacute;i li nh&eacute;! Nu d&acirc;y gi&agrave;y qu&aacute; c th&igrave; bn n&ecirc;n thay th mt d&acirc;y gi&agrave;y mi  &ocirc;i gi&agrave;y tr&ocirc;ng mi hn.</p>\r\n\r\n<p><em>Bc 6:</em></p>\r\n\r\n<p>Tip n, d&ugrave;ng b&agrave;n chi ch&agrave; ming l&oacute;t gi&agrave;y &nbsp;vi nc x&agrave; ph&ograve;ng ri lau kh&ocirc; ming l&oacute;t bng chic khn kh&ocirc; ri  ni kh&ocirc; r&aacute;o. Tuy nhi&ecirc;n, nu ming l&oacute;t &atilde; kh&ocirc; nhng vn c&oacute; m&ugrave;i h&ocirc;i th&igrave; c&oacute; th rc mt &iacute;t bt kh m&ugrave;i  gim m&ugrave;i h&ocirc;i v&agrave; c&aacute;c vi khun g&acirc;y m&ugrave;i.</p>\r\n\r\n<p><em>Bc 7:</em></p>\r\n\r\n<p>Cui c&ugrave;ng ch vic x d&acirc;y v&agrave; gn li nhng ming l&oacute;t &atilde; v sinh sau khi &ocirc;i gi&agrave;y &atilde;&nbsp;kh&ocirc; ho&agrave;n to&agrave;n.</p>\r\n\r\n<p style=\"text-align:center;\"><img alt=\"giay adidas\" data-lazy-src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/10-29.jpg\" data-was-processed=\"true\" height=\"335\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/10-29.jpg\" width=\"500\" /></p>\r\n\r\n<p>Ch&uacute;c c&aacute;c bn th&agrave;nh c&ocirc;ng!</p>\r\n','2019-06-19 15:24:17','2019-06-20 17:08:08',1,2),(4,'<h1><img alt=\"\" src=\"https://bountysneakers.com/wp-content/uploads/2018/06/adidas-size.jpg\" style=\"width: 443px; height: 332px;\" />C&aacute;ch chn size gi&agrave;y Adidas, Nike chun chnh</h1>\r\n','<h2>o chiu rng ca b&agrave;n ch&acirc;n. o gia c&aacute;c ng  b&ecirc;n tr&aacute;i v&agrave; b&ecirc;n phi v&agrave; lu s xung. Nhiu &ocirc;i gi&agrave;y c&oacute; chiu rng kh&aacute;c nhau, v&igrave; vy con s n&agrave;y s quyt nh phi&ecirc;n bn n&agrave;o cn mua .</h2>\r\n\r\n<h2>Bng quy i size gi&agrave;y Adidas (lu &yacute; size nam v&agrave; size n US khi quy i)</h2>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"size-giay\" src=\"https://bountysneakers.com/wp-content/uploads/2018/06/adidas-size.jpg\" /></p>\r\n\r\n<h2>Bng quy i size gi&agrave;y Nike ( lu &yacute; size nam v&agrave; size n US khi i)</h2>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"size-giay\" src=\"https://bountysneakers.com/wp-content/uploads/2018/06/Nike-shoes-size-chart.jpg\" /></p>\r\n\r\n<h3>Lu &yacute;: o c chiu d&agrave;i ch&acirc;n l&agrave; L = 24cm th&igrave; size gi&agrave;y l&agrave; N = 24cm + 1cm = 25cm. Vy c gi&agrave;y bn Adidas Nam ca bn l&agrave; 40.</h3>\r\n\r\n<h2>Hng dn o size gi&agrave;y Adidas, Nike ti nh&agrave;</h2>\r\n\r\n<p style=\"text-align: center;\">1. t 1 t giy A3 hoc A4 xung s&agrave;n nh&agrave;. Bn s cn phi o khu&ocirc;n ch&acirc;n ca m&igrave;nh, do &oacute; n&ecirc;n chn c&aacute;i g&igrave; &oacute; d v hoc vit l&ecirc;n nh giy.<br />\r\n<img src=\"http://bountysneakers.com/wp-content/uploads/2018/05/tim_size_giay_1.jpg\" /></p>\r\n\r\n<p style=\"text-align: center;\">2. t ch&acirc;n ca bn v&agrave;o gia ca kh giy. Ch&acirc;n  trng th&aacute;i thoi m&aacute;i v&agrave; cng ch&acirc;n n&ecirc;n  trc mt c&aacute; ch&acirc;n ca bn. C gng t ch&acirc;n vu&ocirc;ng g&oacute;c vi bt k d&ograve;ng n&agrave;o tr&ecirc;n t giy. Bn c&oacute; th ng, ngi tr&ecirc;n gh hoc c&uacute;i xung.<br />\r\n<img src=\"http://bountysneakers.com/wp-content/uploads/2018/05/tim_size_giay_2.jpg\" /></p>\r\n\r\n<p>3. V ph&aacute;c tho b&agrave;n ch&acirc;n ca bn bng 1 ng lin xung quanh. Bn c&oacute; th mang v m&agrave; bn d nh mc vi &ocirc;i gi&agrave;y mun mua, nhng kh&ocirc;ng mang gi&agrave;y.</p>\r\n\r\n<p>4. &aacute;nh du chiu d&agrave;i v&agrave; chiu rng ca b&agrave;n ch&acirc;n tr&ecirc;n giy. S dng im &aacute;nh du  v ng thng chm v&agrave;o mi b&ecirc;n ca ng vin.</p>\r\n\r\n<p>5. o chiu d&agrave;i b&agrave;n ch&acirc;n. S dng thc o bng hoc thc k  o t tr&ecirc;n xung di. Vit, ghi nh con s n&agrave;y, n&oacute; s quyt nh phn ln c gi&agrave;y ca bn.</p>\r\n\r\n<p>6. o chiu rng ca b&agrave;n ch&acirc;n. o gia c&aacute;c ng  b&ecirc;n tr&aacute;i v&agrave; b&ecirc;n phi v&agrave; lu s xung. Nhiu &ocirc;i gi&agrave;y c&oacute; chiu rng kh&aacute;c nhau, v&igrave; vy con s n&agrave;y s quyt nh phi&ecirc;n bn n&agrave;o cn mua.</p>\r\n\r\n<p>7. Tr khong 0.5 cm t mi s. iu n&agrave;y l&agrave;  ph&ugrave; hp vi kh&ocirc;ng gian nh gia c&aacute;c d&ograve;ng c thc hin bi b&uacute;t ch&igrave; v&agrave; ch&acirc;n thc t ca bn.</p>\r\n\r\n<p style=\"text-align: center;\"><img src=\"http://bountysneakers.com/wp-content/uploads/2018/05/tim_size_giay_7.jpg\" /></p>\r\n\r\n<p>8. S dng s o chiu d&agrave;i v&agrave; chiu rng  t&igrave;m k&iacute;ch thc gi&agrave;y ca bn tr&ecirc;n biu  k&iacute;ch thc. Nam v&agrave; n s dng c&aacute;c k&iacute;ch c kh&aacute;c nhau, cng nh c&aacute;c quc gia kh&aacute;c nhau.<br />\r\n<b>c bit lu &yacute;: size n US s kh&aacute;c vi size nam US, v&agrave; size Adidas US s kh&aacute;c size Nike US.</b></p>\r\n\r\n<p>9. Sm mt &ocirc;i&nbsp;<a href=\"https://bountysneakers.com/danh-muc/adidas/\">gi&agrave;y Adidas</a>, gi&agrave;y Nike ti ca h&agrave;ng&nbsp;<a href=\"http://giayadidas.com.vn/\">Adidas Vit Nam</a>, Nike Vit Nam ngay.</p>\r\n\r\n<p style=\"text-align: center;\"><img src=\"http://bountysneakers.com/wp-content/uploads/2018/05/tim_size_giay_8.jpg\" /></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n','2019-06-19 15:28:42','2019-06-20 17:08:08',1,2),(5,'<h1><img alt=\"\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/14-11.jpg\" style=\"width: 500px; height: 461px;\" />Top 5 Phng Ph&aacute;p Ph&acirc;n Bit Gi&agrave;y Nike N Real Cho C&aacute;c T&iacute;n  Nike</h1>\r\n','<p>Bn l&agrave; t&iacute;n  gi&agrave;y Nike n m&agrave; vn cha d&aacute;m mua v&igrave; c&ograve;n lo s &ldquo;rinh&rdquo; phi  gi? Bn cc k y&ecirc;u th&iacute;ch khi thy c&aacute;c shop gi&agrave;y nike ch&iacute;nh h&atilde;ng qung c&aacute;o nhng mu m&atilde; mi nhng li s &oacute; l&agrave; h&agrave;ng FAKE.</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"giy Nike n\" data-lazy-src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/14-11.jpg\" data-was-processed=\"true\" height=\"461\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/14-11.jpg\" width=\"500\" /></p>\r\n\r\n<p style=\"text-align: center;\"><em>H&igrave;nh nh:&nbsp;gi&agrave;y Nike n</em></p>\r\n\r\n<h2><strong>1. Nhn bit qua Tem gi&agrave;y Nike n</strong></h2>\r\n\r\n<p>Ging vi c&aacute;c sn phm kh&aacute;c, i vi Gi&agrave;y Nike sau khi th&agrave;nh phm xut ra th trng ti&ecirc;u th. Mi &ocirc;i gi&agrave;y iu c gn cho m&igrave;nh mt nh&atilde;n m&aacute;c. Cn c v&agrave;o &oacute; nhn din c &ocirc;i gi&agrave;y c sn xut  &acirc;u? Ng&agrave;y th&aacute;ng sn xut, cht liu, m&agrave;u sc, th trng ph&acirc;n phi, k&iacute;ch thc sn phm&hellip; V&igrave; vy: C&aacute;ch ch&iacute;nh x&aacute;c nht  kim tra  tht gi ca mt &ocirc;i gi&agrave;y Nike n &oacute; ch&iacute;nh l&agrave; tem gi&agrave;y. Tem gi&agrave;y&nbsp; vi mc &iacute;ch nhm nhn bit v&agrave; bo v sn phm ca m&igrave;nh trc nhng mt h&agrave;ng nh&aacute;i, k&eacute;m cht lng.</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"giy Nike n\" data-lazy-src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/1-34.jpg\" data-was-processed=\"true\" height=\"392\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/1-34.jpg\" width=\"500\" /></p>\r\n\r\n<p>Tem gi&agrave;y Nike thng c &eacute;p nhit hoc may tr&ecirc;n li g&agrave;, m&aacute; trong hoc t&ecirc;n tm l&oacute;t (vi mt s d&ograve;ng nh Flyknit Free Run) ca gi&agrave;y. Tem ch&iacute;nh h&atilde;ng s c&oacute; nhng c im sau:</p>\r\n\r\n<p><strong>a. B mt tem b&oacute;ng mn, c&oacute;  co gi&atilde;n nh.</strong></p>\r\n\r\n<p>i vi tem ca gi&agrave;y nike ch&iacute;nh h&atilde;ng c sn xut h&agrave;ng lot theo mt m&atilde; s kh&aacute;c nhau. Tem c &eacute;p t m&aacute;y nhit, vi mc in l&ecirc;n tem c&oacute;  n&eacute;t cao chu c t&aacute;c ng c&aacute;c yu t h&oacute;a hc v&agrave; kh&ocirc;ng phai theo thi gian. B&ecirc;n ngo&agrave;i tem c ph mt lp keo b&oacute;ng mn, nhm bo v mc ch tr&ecirc;n tem. Kh&aacute;c vi nhng tem gi d b xung m&agrave;u v&agrave; nh&ograve;a trc nhit  cao v&agrave; nc. i vi tem ca gi&agrave;y nike ch&iacute;nh h&atilde;ng s kh&ocirc;ng b hai yu t va n&ecirc;u.</p>\r\n\r\n<p><strong>b. M&atilde; sn phm (Check Code):</strong></p>\r\n\r\n<p>D&atilde;y s c khoanh tr&ograve;n ch&iacute;nh l&agrave; m&atilde; k&yacute; hiu mu v&agrave; m&agrave;u ca gi&agrave;y.  kim tra gi&agrave;y tht hay gi bn ch cn g&otilde; d&ograve;ng m&atilde; n&agrave;y k&egrave;m theo ch &ldquo;Nike&rdquo; tr&ecirc;n trang t&igrave;m kim ri chn phn t&igrave;m kim h&igrave;nh nh.</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"giy Nike n\" data-lazy-src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/2-32.jpg\" data-was-processed=\"true\" height=\"392\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/2-32.jpg\" width=\"500\" /></p>\r\n\r\n<p><strong>c. Kim tra ph&ocirc;ng ch:</strong></p>\r\n\r\n<p>Ph&ocirc;ng ch tr&ecirc;n nn tem gi&agrave;y nike l&agrave; ph&ocirc;ng ch c trng d&ugrave;ng  nhn din thng hiu ca Nike k&egrave;m logo m&agrave; kh&ocirc;ng mt n v n&agrave;o c&oacute; th l&agrave;m nh&aacute;i.</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"giy Nike n\" data-lazy-src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/3-30.jpg\" data-was-processed=\"true\" height=\"253\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/3-30.jpg\" width=\"500\" /></p>\r\n\r\n<p style=\"text-align: center;\">Ch in m m&agrave;u, sc n&eacute;t, c&oacute; khong c&aacute;ch v&agrave; chiu cao u nhau. C&ograve;n gi&agrave;y gi thng s in ch lem luc v&agrave; ph&ocirc;ng ch cng kh&ocirc;ng thng nht. (nh: etasi.vn)</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"giy Nike n\" data-lazy-src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/4-21.jpg\" data-was-processed=\"true\" height=\"253\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/4-21.jpg\" width=\"500\" /></p>\r\n\r\n<p style=\"text-align: center;\">c bit, c&aacute;c ch &ldquo;e&rdquo; trong d&ograve;ng &ldquo;nikebetterworld.com&rdquo; s c&oacute; phn u&ocirc;i lu&ocirc;n c vut nhn. (nh: etasi.vn)</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"giy Nike n\" data-lazy-src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/5-28.jpg\" data-was-processed=\"true\" height=\"253\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/5-28.jpg\" width=\"500\" /></p>\r\n\r\n<p style=\"text-align: center;\">Khong c&aacute;ch gia c&aacute;c ch &ldquo;MADE&rdquo; trong ch &ldquo;MADE IN VIETNAM&rdquo; cng u nhau ch kh&ocirc;ng bin th&agrave;nh &ldquo;MA DE&rdquo;. (nh: etasi.vn)</p>\r\n\r\n<p><strong>d. i vi tem &eacute;p nhit:</strong>&nbsp;s c&oacute;  phng nht nh do c&oacute; kh&ocirc;ng kh&iacute; b&ecirc;n trong, vin tem c gia nhit chy n&ecirc;n b&aacute;m d&iacute;nh u v&agrave;o b mt cht liu gi&agrave;y.</p>\r\n\r\n<p><strong>e. V tr&iacute; k&yacute; t &ldquo;EUR&rdquo; &ldquo;ng n&oacute;c&rdquo;:</strong>&nbsp;Th&ocirc;ng thng,  d&ograve;ng ghi k&iacute;ch c gi&agrave;y, ch &ldquo;US&rdquo; hoc ch &ldquo;EUR&rdquo; s cao hn c&aacute;c ch &ldquo;UK&rdquo; v&agrave; &ldquo;cm&rdquo;.</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"giy Nike n\" data-lazy-src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/6-31.jpg\" data-was-processed=\"true\" height=\"253\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/6-31.jpg\" width=\"500\" /></p>\r\n\r\n<p style=\"text-align: center;\">a s c&aacute;c d&ograve;ng &ldquo;EUR&rdquo; tr&ecirc;n tem gi&agrave;y u cao hn c&aacute;c ch c&ograve;n li. (nh: etasi.vn)</p>\r\n\r\n<p>Tuy nhi&ecirc;n khi tr&ecirc;n tem in m&atilde; nh&agrave; m&aacute;y (ph&iacute;a tr&ecirc;n c&ugrave;ng b&ecirc;n phi) l&agrave; &ldquo;VE&rdquo; (Vit Nam), &ldquo;JJ&rdquo; (Indonesia)&hellip; hoc nhng &ocirc;i&nbsp;gi&agrave;y tr em&nbsp;(Kid&rsquo;s) th&igrave; ch &ldquo;US&rdquo; hoc &ldquo;EUR&rdquo; s kh&ocirc;ng c in cao hn.</p>\r\n\r\n<p><strong>f. ng thng t l:</strong></p>\r\n\r\n<p style=\"text-align: center;\">Bn k mt ng thng t u du &ldquo;Swoosh&rdquo; xung, n&oacute; s i qua gia ch &ldquo;t&rdquo; v&agrave; &ldquo;e&rdquo; ca d&ograve;ng &ldquo;nikebetterworld.com&rdquo;, gia ch &ldquo;U&rdquo; v&agrave; &ldquo;K&rdquo; ca d&ograve;ng &ldquo;UK&rdquo; v&agrave; ch s th 3 tr&ecirc;n d&ograve;ng M&atilde; sn phm.<img alt=\"giy Nike n\" data-lazy-src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/7-27.jpg\" data-was-processed=\"true\" height=\"253\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/7-27.jpg\" width=\"500\" /><br />\r\nng thng t l tr&ecirc;n gi&agrave;y gi s b lch hn i. (nh: etasi.vn)</p>\r\n\r\n<h2><strong>2. Ph&acirc;n bit gi&agrave;y Nike n ch&iacute;nh h&atilde;ng qua cht liu v&agrave; cht lng gia c&ocirc;ng</strong></h2>\r\n\r\n<p>C&aacute;c sn phm Nike ch&iacute;nh h&atilde;ng c&oacute; cht liu tt hn rt nhiu so vi gi&agrave;y fake. Vi quy tr&igrave;nh sn xut kh&eacute;p k&iacute;n. Mi b phn ca gi&agrave;y c chun h&oacute;a bi c&aacute;c b phn gia c&ocirc;ng kh&aacute;c nhau. Nh b phn  s do xng  sn xut, b phn d&aacute;n keo s do xng keo ph tr&aacute;ch,&hellip;. Cho n&ecirc;n s cho ra mt &ocirc;i gi&agrave;y chun kh&ocirc;ng b li  c&aacute;c kh&acirc;u d&ugrave; l&agrave; nh nht.</p>\r\n\r\n<p>i vi c&aacute;c sn phm gi&agrave;y nike b li, s c nh&agrave; m&aacute;y thu hi v&agrave; ct b c mt d&acirc;y chuyn ( ch kh&ocirc;ng phi loi b tng &ocirc;i ). N&ecirc;n gi&agrave;y nike ch&iacute;nh h&atilde;ng s kh&ocirc;ng bao gi b li d&ugrave; l&agrave; yu t nh nht.</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"giy Nike n\" data-lazy-src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/8-3.png\" data-was-processed=\"true\" height=\"434\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/8-3.png\" width=\"500\" /></p>\r\n\r\n<p style=\"text-align: center;\"><em>H&igrave;nh nh:&nbsp;gi&agrave;y Nike n</em></p>\r\n\r\n<p>C&aacute;c  gi&agrave;y ch&iacute;nh h&atilde;ng &ecirc;m v&agrave; mm hn tuy nhi&ecirc;n form vn rt chc chn v&agrave; ng form kh&ocirc;ng b mt form khi mang mt thi gian l&acirc;u d&agrave;i.</p>\r\n\r\n<p>Phn tr&ecirc;n ca c&aacute;c mu gi&agrave;y real rt tinh t v&agrave; t m trong tng chi tit, c bit l&agrave; vi nhiu mu gi&agrave;y Nike c&oacute; ph&acirc;n th&acirc;n c&oacute; kt cu phc tp nh Nike Flyknit.</p>\r\n\r\n<p>V cht lng gia c&ocirc;ng th&igrave; vi sn phm gi&agrave;y Nike ch&iacute;nh h&atilde;ng, cht lng gia c&ocirc;ng cc k&igrave; tinh xo, c bit  c&aacute;c ng may di l&oacute;t gi&agrave;y, c&aacute;c ng may tr&ecirc;n upper di li g&agrave; thng rt u v&agrave; hu nh kh&ocirc;ng b li ch. t bit ti c&aacute;c ng keo, rt gn g&agrave;ng v&agrave; sch. Cho n&ecirc;n nu gi&agrave;y nike ch&iacute;nh h&atilde;ng p l&agrave; iu m&agrave; c&aacute;c gi&agrave;y nike FAKE kh&aacute;c kh&ocirc;ng th so s&aacute;nh.</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"giy Nike n\" data-lazy-src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/9-4.png\" data-was-processed=\"true\" height=\"238\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/9-4.png\" width=\"500\" /></p>\r\n\r\n<p style=\"text-align: center;\"><em>H&igrave;nh nh:&nbsp;gi&agrave;y Nike n</em></p>\r\n\r\n<p>Tuy nhi&ecirc;n, ng&agrave;y nay mc  tinh xo ca gi&agrave;y Nike FAKE ng&agrave;y c&agrave;ng c ci thin. Nu bn kh&ocirc;ng  &yacute; k s d b nhm ln gia tht v&agrave; gi.</p>\r\n\r\n<h2><strong>3. Ph&acirc;n bit gi&agrave;y Nike n ch&iacute;nh h&atilde;ng qua gi&aacute; b&aacute;n</strong></h2>\r\n\r\n<p>Ti hai th trng ln nht Vit Nam l&agrave; H Ch&iacute; Minh v&agrave; H&agrave; Ni. Nguy&ecirc;n ca lng t kh&oacute;a search tr&ecirc;n google, 2 keyword vn c t&iacute;n  gi&agrave;y nike ch&uacute; &yacute; &oacute; l&agrave; &ldquo;gi&agrave;y nike ch&iacute;nh h&atilde;ng h ch&iacute; minh&rdquo; v&agrave; &ldquo;gi&agrave;y nike ch&iacute;nh h&atilde;ng h&agrave; ni&rdquo;.</p>\r\n\r\n<p>Ti hai th trng n&agrave;y, c&aacute;c bn c tip cn nhiu ngun th&ocirc;ng tin t c&aacute;c din &agrave;n, c&aacute;c webstie b&aacute;n gi&agrave;y nike. Nhng vn con ln tn  i t&igrave;m &acirc;u l&agrave; gi&agrave;y nike ch&iacute;nh h&atilde;ng. Yu t l&agrave;m c&aacute;c bn ln tn &oacute; l&agrave; gi&aacute; b&aacute;n?</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"giy Nike n\" data-lazy-src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/10-22.jpg\" data-was-processed=\"true\" height=\"395\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/10-22.jpg\" width=\"500\" /></p>\r\n\r\n<p style=\"text-align: center;\"><em>H&igrave;nh nh:&nbsp;gi&agrave;y Nike n</em></p>\r\n\r\n<p>C&oacute; ca h&agrave;ng gi&agrave;y A b&aacute;n nike ch&iacute;nh h&atilde;ng gi&aacute; 2 triu, nhng cng c&oacute; ca h&agrave;ng gi&agrave;y B b&aacute;n sn phm tng t gi&aacute; 3 triu, hoc c&oacute; ca h&agrave;ng li gi&aacute; thp hn 2 triu. Yu t gi&aacute; l&agrave;m cho c&aacute;c bn b x&aacute;o trn nhn thc trong vic ph&acirc;n bit &acirc;u l&agrave; tht &acirc;u l&agrave; gi. D&ugrave; &atilde; c k c hai yu t nhn bit gi&agrave;y nike tht vi mc  ch&iacute;nh x&aacute;c cao  tr&ecirc;n.</p>\r\n\r\n<p>i vi gi&agrave;y nike ch&iacute;nh h&atilde;ng, gi&aacute; cho mt &ocirc;i gi&agrave;y tht kh&oacute;  thp hn 2 triu. Ch mt s trng hp c b&aacute;n trong s kin Bigsale hoc gi&agrave;y tn kho ca c&aacute;c ca h&agrave;ng gi&agrave;y nike cn c thanh l&yacute;. i vi gi&agrave;y nike FAKE cht lng b&igrave;nh thng c&oacute; gi&aacute; t 300-700 ngh&igrave;n/ &ocirc;i, t&ugrave;y sn phm v&agrave; mu m&atilde;. i vi gi&agrave;y Nike FAKE vi cht lng tt hn&nbsp; gi&aacute; c&oacute; th giao ng tr&ecirc;n di 1 triu. &acirc;y ch&iacute;nh l&agrave; c&aacute;ch m&agrave; c&aacute;c bn i mua d b sp by do ch&iacute;nh bn th&acirc;n m&igrave;nh to n&ecirc;n.</p>\r\n\r\n<p><strong>&ldquo;Tin n&agrave;o ca y&rdquo; &oacute; l&agrave; c&aacute;i gi&aacute; ca nhng gi&agrave;y hiu m&agrave; bn cn chi ti&ecirc;u. Mc  ch&iacute;nh x&aacute;c ca c&aacute;ch n&agrave;y ri v&agrave;o khong 65%.</strong></p>\r\n\r\n<h2><strong>4. Ph&acirc;n bit qua m&ugrave;i keo d&aacute;n ca gi&agrave;y Nike n</strong></h2>\r\n\r\n<p>Bo i ngi m&ugrave;i keo gi&agrave;y nghe c&oacute; v l bch, nh i mua mt m&oacute;n n phi ngi n&oacute; trc vy. Tuy nhi&ecirc;n, do t&iacute;nh c th&ugrave; trong chui sn xut kh&eacute;p k&iacute;n. N&ecirc;n keo  d&aacute;n gi&agrave;y Nike cng kh&aacute;c vi keo ca c&aacute;c loi gi&agrave;y kh&aacute;c.</p>\r\n\r\n<p><em>Mt c&acirc;u hi t ra l&agrave; &ldquo; t&ocirc;i cha thy keo &oacute; h&igrave;nh dng th n&agrave;o, m&ugrave;i ra l&agrave;m sao th&igrave; l&agrave;m th n&agrave;o  ph&acirc;n bit c&rdquo;. ng vi, ch&uacute;ng t&ocirc;i &atilde; tng test qua v&agrave; ang chia s li cho c&aacute;c bn sau &acirc;y.</em></p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" data-lazy-src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/11-19.jpg\" data-was-processed=\"true\" height=\"424\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/11-19.jpg\" width=\"500\" /></p>\r\n\r\n<p style=\"text-align: center;\"><em>H&igrave;nh nh:&nbsp;gi&agrave;y Nike n</em></p>\r\n\r\n<p>C&aacute;c sn phm ch&iacute;nh h&atilde;ng ca gi&agrave;y nike c&oacute; m&ugrave;i keo nh hn c&aacute;c loi keo th&ocirc;ng thng kh&aacute;c. Kh&ocirc;ng b hc v&agrave; kh&oacute; ngi nh c&aacute;c sn phm gia c&ocirc;ng ngo&agrave;i hoc l&agrave;m nh&aacute;i. Nhng nu ai bo ch&uacute;ng d chu khi ngi th&igrave; kh&ocirc;ng h. Nhng m&ugrave;i keo m&agrave; c&aacute;c bn ngi tr&ecirc;n &ocirc;i gi&agrave;y &atilde; phn n&agrave;o b phai do tri qua nhiu c&ocirc;ng on  to ra th&agrave;nh phm di t&aacute;c ng ca nhit v&agrave; thi gian xut kho.</p>\r\n\r\n<p> ph&acirc;n bit qua m&ugrave;i keo c&oacute; mt ch&uacute;t kh&oacute; khn, c bit vi c&aacute;c mu gi&agrave;y &atilde; sn xut mt thi gian v&agrave; trng b&agrave;y ti ca h&agrave;ng. Tht s t&ocirc;i rt bun ci khi tham kho v&agrave; vit ti on n&agrave;y. Nhng thc t &oacute; li l&agrave; mt c&aacute;ch  bn c&oacute; th nhn din c n&oacute; c&oacute; thc s l&agrave; gi&agrave;y Nike n&nbsp;Real kh&ocirc;ng?</p>\r\n\r\n<p>M&ugrave;i keo ca gi&agrave;y nike tht sau khi c b&agrave;y b&aacute;n  c&aacute;c shop gi&agrave;y nike hoc c&aacute;c ca h&agrave;ng gi&agrave;y nike s ging nh m&ugrave;i vi. Kh&ocirc;ng h&ocirc;i, kh&ocirc;ng hc ( tht ra do cht liu l&agrave;m gi&agrave;y nike c&oacute; kh nng kh&aacute;ng khun n&ecirc;n gi&agrave;y mi kh&ocirc;ng h&ocirc;i). C&oacute; ch&uacute;t lo&aacute;ng tho&aacute;ng m&ugrave;i ca nilong. C&ograve;n n&oacute;i m&ugrave;i keo ca gi&agrave;y nike th n&agrave;o th&igrave; ti ca h&agrave;ng shopgiaytvt, ch&uacute;ng t&ocirc;i cho c&aacute;c bn tri nghim. Tht s n&oacute; kh&ocirc;ng du d&agrave;ng nh c&aacute;c trang kh&aacute;c vit.</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"giy Nike n\" data-lazy-src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/12-12.jpg\" data-was-processed=\"true\" height=\"300\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/12-12.jpg\" width=\"500\" /></p>\r\n\r\n<p style=\"text-align: center;\"><em>H&igrave;nh nh:&nbsp;gi&agrave;y Nike n</em></p>\r\n\r\n<h2><strong>5. Ph&acirc;n bit gi&agrave;y Nike n bng kinh nghim v&agrave; th&ocirc;ng tin th trng</strong></h2>\r\n\r\n<p>Nu c&aacute;c bn c&oacute; iu kin  mua c nhng &ocirc;i gi&agrave;y Nike t Store / ca h&agrave;ng i l&yacute; u quyn ca Nike ti Vit Nam th&igrave; chc chn 100% c&aacute;c bn &atilde; mua c gi&agrave;y ch&iacute;nh h&atilde;ng ri. Chc chn rng gi&aacute; s cao v&agrave; kh&ocirc;ng phi mu n&agrave;o cng c&oacute;.</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"giy Nike n\" data-lazy-src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/13-7.jpg\" data-was-processed=\"true\" height=\"333\" src=\"https://thatlungnam.com.vn/wp-content/uploads/2019/03/13-7.jpg\" width=\"500\" /></p>\r\n\r\n<p style=\"text-align: center;\"><em>H&igrave;nh nh:&nbsp;gi&agrave;y Nike n</em></p>\r\n\r\n<p>i vi 1 s bn mun tit kim chi ph&iacute; th&igrave; s t&igrave;m n nhng c&aacute; nh&acirc;n, t chc b&aacute;n gi&agrave;y Nike n&nbsp;Vit Nam Xut Khu&nbsp;(Nike VNXK) hoc h&agrave;ng order, x&aacute;ch tay t nc ngo&agrave;i. Trng hp n&agrave;y c&aacute;c bn cn c&acirc;n nhc, check h&agrave;ng k  tr&aacute;nh mua phi h&agrave;ng fake nh&eacute;.</p>\r\n\r\n<p>Nh vy ch&uacute;ng ta va tri qua 5phng ph&aacute;p  x&aacute;c nh&nbsp;c &acirc;u l&agrave; gi&agrave;y nike ch&iacute;nh h&atilde;ng. V&agrave; mc  ch&iacute;nh x&aacute;c  mi phng &aacute;n l&agrave; kh&aacute;c nhau. C&aacute;c bn h&atilde;y dung h&ograve;a c&aacute;c phng ph&aacute;p  a ra c quyt nh cui c&ugrave;ng.</p>\r\n','2019-06-19 15:57:50','2019-06-20 17:08:08',1,2),(7,'<h1><img alt=\"\" src=\"https://diadiemanuong.edu.vn/wp-content/uploads/2019/06/hot-nhanh-keo-het-nike-choi-lon-giam-50-tat-ca-cac-san-pham-tren-toan-quoc-dc78cd4a636952459268202096-200x300.jpg\" />5 NG&Agrave;Y SALE SC &ndash;