00x171.jpg 300w\" data-was-processed=\"true\" height=\"400\" sizes=\"(max-width: 700px) 100vw, 700px\" src=\"https://snkrvn.com/wp-content/uploads/2016/06/nike-kobe-11-EM-draft-day-2.jpg\" srcset=\"https://snkrvn.com/wp-content/uploads/2016/06/nike-kobe-11-EM-draft-day-2.jpg 700w, https://snkrvn.com/wp-content/uploads/2016/06/nike-kobe-11-EM-draft-day-2-600x343.jpg 600w, https://snkrvn.com/wp-content/uploads/2016/06/nike-kobe-11-EM-draft-day-2-300x171.jpg 300w\" width=\"700\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>H&atilde;y share nu thy n&oacute; hu &iacute;ch vi bn hay ngi th&acirc;n ca bn nh&eacute;.&nbsp;</strong></p>\r\n','2019-06-19 16:21:14','2019-06-19 16:23:53',2,2),(9,'<h1><img alt=\"\" src=\"https://dosi-in.com/wp-content/uploads/2019/01/NikeCNY2019_DB_CNY_BS_FIN_hd_1600-1024x576.jpg\" style=\"width: 1024px; height: 576px;\" />Nike gii thiu v b sn phm Chinese New Year vi phong c&aacute;ch kh&aacute;c bit</h1>\r\n','<blockquote>\r\n<p><em><strong>Nh Dosiin &atilde; tng gii thiu  lot b&agrave;i vit trc &acirc;y, Chinese New Year (CNY) l&agrave; mt trong nhng b sn phm c sc m&agrave; c&aacute;c thng hi&ecirc;u thng ra mt mi nm d&agrave;nh ri&ecirc;ng cho th trng &Aacute; &ocirc;ng.</strong></em></p>\r\n</blockquote>\r\n\r\n<p>C&oacute; th v&iacute; von rng, c&aacute;c b sn phm CNY ging nh ch&iacute;nh chuong tr&igrave;nh T&aacute;o Qu&acirc;n &ndash; l&agrave; mt m&oacute;n n tinh thn kh&ocirc;ng th thiu i vi nhiu ngi mi dp Tt n Xu&acirc;n v. ng thi, n&oacute; cng th hin s quan t&acirc;m v&agrave; t&ocirc;n trng c&aacute;c di sn vn ho&aacute; ca ngi &Aacute; &ocirc;ng, khin thng hiu tr n&ecirc;n gn gi hn vi c&aacute;c kh&aacute;ch h&agrave;ng v&agrave; ngi h&acirc;m m.</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" height=\"574\" src=\"https://dosi-in.com/wp-content/uploads/2019/01/NikeCNY2019_DB_CNY_BS_FIN_hd_1600-1024x576.jpg\" width=\"1020\" /></p>\r\n\r\n<p>Vi Nike, vic s dng a ho tit kh&ocirc;ng phi bi Nike &atilde; b&iacute; &yacute; tng trong vic truyn ti tinh thn ca nm K Hi &ndash; m&agrave; n&oacute; li nm  mt c&acirc;u chuyn to ln hn m&agrave; Dosiin s nhc n sau &acirc;y.</p>\r\n\r\n<p>Vi tp tc ca ngi phng &ocirc;ng, cng ch&iacute;nh l&agrave; vn ho&aacute; ca ch&uacute;ng ta th&igrave; t&ecirc;n gi ca nhng ch&ograve;m sao quen thuc nh Bo B&igrave;nh, Thi&ecirc;n B&igrave;nh, Bach Dng,&hellip; hay tng hp li c&ograve;n gi l&agrave; Cung Ho&agrave;ng o li kh&ocirc;ng phi h thng t&iacute;nh to&aacute;n c trng. M&agrave; Can Chi, vn tt li t cm ch Thp Can Thp Nh Chi mi l&agrave; h thng &aacute;nh s th&agrave;nh chu k&igrave; c s dng.</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" height=\"501\" src=\"https://dosi-in.com/wp-content/uploads/2019/01/Horoscopo_Chino_u_Horoscopo_Occidental_%C2%BFCua%CC%81l_eliges-.jpg\" width=\"1003\" /></p>\r\n\r\n<p>Theo Wikipedia, Can Chi c &aacute;p dng vi t hp chu k&igrave; s&aacute;u mi trong &acirc;m lch n&oacute;i chung  x&aacute;c nh t&ecirc;n gi ca thi gian. C&ograve;n trong i sng, ch&uacute;ng ta bit ti n gin hn l&agrave; 12 con Gi&aacute;p khi u t: T&iacute; (Chut) &ndash; Su (Tr&acirc;u) &ndash; Dn (H) &ndash; M&atilde;o/Mo (M&egrave;o/Th) &ndash; Th&igrave;n (Rng) &ndash; T (Rn) &ndash; Ng (Nga) &ndash; M&ugrave;i (D&ecirc;/Cu) &ndash; Th&acirc;n (Kh) &ndash; Du (G&agrave;) &ndash; Tut (Ch&oacute;) &ndash; Hi (Heo). Nm 2019 n&agrave;y, hay theo s ph&acirc;n chia ch&iacute;nh l&agrave; nm K Hi, ng thi cng ch&iacute;nh l&agrave; con vt kt th&uacute;c cho 1 gi&aacute;p ch&iacute;nh l&agrave; &yacute; ngha ch&iacute;nh cho to&agrave;n b c&aacute;c thit k n t BST n&agrave;y.</p>\r\n\r\n<p>Kh&ocirc;ng nh nhng ph&aacute;t h&agrave;nh trc &acirc;y, m&agrave; Nike ng dng phong c&aacute;ch &ldquo;What The&rdquo; quen thuc cc ni ting ca m&igrave;nh v&agrave;o trong c&aacute;c thit k gii hn ln n&agrave;y. To&agrave;n b nhng ho tit &atilde; tng xut hin  c&aacute;c nm trc u hin din tr li, nhng ch di 1 phi&ecirc;n bn duy nht ch&iacute;nh l&agrave; Air Max 98 &ndash; mt h&igrave;nh thc n d cho k hoch ph&aacute;t trin nm 2019 ca thng hiu n&agrave;y chng.</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" height=\"1020\" src=\"https://dosi-in.com/wp-content/uploads/2018/12/nike-air-max-98-chinese-new-year-what-the-1-1024x1024.jpg\" width=\"1020\" /></p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" height=\"1020\" src=\"https://dosi-in.com/wp-content/uploads/2018/12/nike-air-max-98-chinese-new-year-what-the-2-1024x1024.jpg\" width=\"1020\" /></p>\r\n\r\n<p>Vi c&aacute;c sn phm c&ograve;n li, ho tit th&ecirc;u ni ting ca Trung Hoa vi vic lp gh&eacute;p c&aacute;c mnh vi a sc m&agrave;u cng c ng dng rt ho&agrave;n ho. iu n&agrave;y c th hin rt r&otilde;  phn g&oacute;t sau ca mu gi&agrave;y Kyrie 5, hay to&agrave;n b th&acirc;n gi&agrave;y ca mu Converse Chuck Taylor kinh in. Kh&ocirc;ng n&oacute;i nhiu hn v thit k Air Max 98, bi ch&uacute;ng t&ocirc;i ngh rng  li c&ocirc;ng vic t&igrave;m hiu tng sc m&agrave;u c&oacute; tr&ecirc;n phi&ecirc;n bn n&agrave;y s l&agrave; mt c&ocirc;ng vic cc l&yacute; th&uacute; m&agrave; bn n&ecirc;n l&agrave;m y.</p>\r\n\r\n<p>B sn phm &atilde; ch&iacute;nh thc ph&aacute;t h&agrave;nh mt v&agrave;i sn phm nm trong d&ograve;ng Jordan, v&agrave; Nike Performance. Ri&ecirc;ng vi nhng thit k hp dn c&ograve;n li, c&oacute; l thi gian v&agrave; a im ph&aacute;t h&agrave;nh xin h&atilde;y c&ugrave;ng i ch bn nh&eacute;.</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" height=\"1020\" src=\"https://dosi-in.com/wp-content/uploads/2019/01/NikeCNY2019_DB_CNY_RN_Mobile_FIN_square_1600-1024x1024.jpg\" width=\"1020\" /></p>\r\n','2019-06-19 16:27:08','2019-06-20 17:25:03',3,2),(10,'<h1><img alt=\"\" src=\"https://mitsloan.mit.edu/sustainability/images/large/Nike.jpg\" style=\"width: 1581px; height: 1020px;\" />C&acirc;u chuyn v du Swoosh tr&ecirc;n logo ca Nike</h1>\r\n','<h4>C&oacute; kh&ocirc;ng nhiu nh&atilde;n h&agrave;ng c&oacute; th s hu c kh nng nhn din thng hiu ch vi s xut hin ca logo m&agrave; kh&ocirc;ng cn k&egrave;m theo t&ecirc;n thng hiu. Mt trong s &oacute; l&agrave; Nike, biu tng du phy hng l&ecirc;n Swoosh ca thng hiu n&agrave;y t c  nhn din th&agrave;nh c&ocirc;ng n mc kh&ocirc;ng cn s xut hin ca 4 k&yacute; t Nike. Vy th&igrave;, Nike ni ting nh Swoosh hay Swoosh nh Nike m&agrave; &ldquo;hng k&eacute; s ni ting&rdquo;?</h4>\r\n\r\n<p><strong>V&ocirc; t&igrave;nh &ldquo;chm tr&aacute;n&rdquo; bao rc ri, Nike v&agrave; Swoosh vn n sau tt c</strong></p>\r\n\r\n<p>Trong trn u gia hai i tuyn b&oacute;ng r North Calironia v&agrave; Duke, &ocirc;i Nike m&agrave; Zion Williamson ang mang b r&aacute;ch toc ngay gi&acirc;y th 33 khin cu th n&agrave;y b chn thng u gi kh&aacute; nghi&ecirc;m trng. S c n&agrave;y kh&ocirc;ng ch g&acirc;y rc ri cho Williamson m&agrave; h&igrave;nh nh ca Nike cng b nh hng kh&ocirc;ng &iacute;t. C th l&agrave; c phiu ca Nike &atilde; &ldquo;bay mt&rdquo; 1,12 t &ocirc; la v&agrave;o ngay s&aacute;ng h&ocirc;m sau trn u y.</p>\r\n\r\n<p style=\"text-align: center;\"><a href=\"https://advertisingvietnam.com/2019/03/cau-chuyen-ve-dau-swoosh-tren-logo-cua-nike/logo-nike-swoosh/\" rel=\"attachment wp-att-33541\"><img alt=\"\" height=\"458\" sizes=\"(max-width: 688px) 100vw, 688px\" src=\"https://advertisingvietnam.com/wp-content/uploads/2019/03/logo-nike-swoosh.jpg\" srcset=\"https://advertisingvietnam.com/wp-content/uploads/2019/03/logo-nike-swoosh.jpg 480w, https://advertisingvietnam.com/wp-content/uploads/2019/03/logo-nike-swoosh-300x200.jpg 300w\" width=\"688\" /></a></p>\r\n\r\n<p>N&oacute;i v vic i din vi khng hong th&igrave; kh&ocirc;ng &iacute;t ln Nike g&acirc;y ra tranh c&atilde;i vi c&aacute;c chin dch tng thc hin. Gn &acirc;y nht, Nike tng b cun v&agrave;o &ldquo;l&agrave;n s&oacute;ng&rdquo; ty chay khi thc hin chin dch Colin Kaepernick. Nhng n thi im hin ti, Nike vn ng vng tr&ecirc;n th trng, gi&agrave;y th thao Nike vn l&agrave; mt trong nhng la chn h&agrave;ng u ca ngi ti&ecirc;u d&ugrave;ng tr&ecirc;n khp th gii.</p>\r\n\r\n<p>Sau tt c, Nike vn n. C vi &ldquo;pht r&aacute;ch gi&agrave;y&rdquo; ca Williamson ln n&agrave;y. Bi kh&ocirc;ng v&igrave; s c tr&ecirc;n m&agrave; cu th b&oacute;ng r i tuyn Duke &ldquo;t chi&rdquo; Nike, anh vn mang sn phm ca Nike trong gii u sau chn thng.&nbsp;T nhng rc ri kh&ocirc;ng &aacute;ng c&oacute;, Nike r&uacute;t ra cho m&igrave;nh nhng b&agrave;i hc trong vic chn la nh&acirc;n vt i din cho c&aacute;c chin dch truyn th&ocirc;ng, b&agrave;i hc trong vic kim duyt sn phm.</p>\r\n\r\n<p style=\"text-align: center;\"><a href=\"https://advertisingvietnam.com/2019/03/cau-chuyen-ve-dau-swoosh-tren-logo-cua-nike/logo-nike/\" rel=\"attachment wp-att-33542\"><img alt=\"\" height=\"500\" sizes=\"(max-width: 890px) 100vw, 890px\" src=\"https://advertisingvietnam.com/wp-content/uploads/2019/03/logo-nike.jpg\" srcset=\"https://advertisingvietnam.com/wp-content/uploads/2019/03/logo-nike.jpg 890w, https://advertisingvietnam.com/wp-content/uploads/2019/03/logo-nike-300x169.jpg 300w, https://advertisingvietnam.com/wp-content/uploads/2019/03/logo-nike-768x431.jpg 768w, https://advertisingvietnam.com/wp-content/uploads/2019/03/logo-nike-696x391.jpg 696w, https://advertisingvietnam.com/wp-content/uploads/2019/03/logo-nike-748x420.jpg 748w\" width=\"890\" /></a></p>\r\n\r\n<p>Mt kh&iacute;a cnh t&iacute;ch cc d&agrave;nh cho Nike trong s c ti trn u b&oacute;ng r va ri: ch cn nh&igrave;n v&agrave;o biu tng du phy hng l&ecirc;n, ai cng nhn ra &ocirc;i gi&agrave;y m&agrave; Williamson ang mang l&agrave; ca Nike ch kh&ocirc;ng phi h&atilde;ng n&agrave;o kh&aacute;c. iu &oacute; chng minh rng logo Nike th hin sc mnh nhn din thng hiu v&ocirc; c&ugrave;ng mnh m. Trng hp n&agrave;y l&agrave; v&iacute; d in h&igrave;nh cho vic mt logo ni ting c&oacute; tm nh hng nh th n&agrave;o n thng hiu m&agrave; n&oacute; i din.</p>\r\n\r\n<p><strong>Swoosh &ndash; logo tr gi&aacute; 35 &ocirc; ca Nike c to ra bi mt sinh vi&ecirc;n chuy&ecirc;n ng&agrave;nh thit k  ha</strong></p>\r\n\r\n<p>V&agrave;o nm 1971, Phil Knight (l&uacute;c &oacute; ang iu h&agrave;nh c&ocirc;ng ty Blue Ribbon Sports chuy&ecirc;n nhp khu gi&agrave;y th thao Onitsuka Tiger ca Nht) &atilde; thu&ecirc; Carolyn Davidson, c&ocirc; sinh vi&ecirc;n ng&agrave;nh thit k  ha ti i hc Portland nhim v thit k gp cho &ocirc;ng mt logo cho thng hiu Nike vi gi&aacute; 35 &ocirc; la.</p>\r\n\r\n<p>Da v&agrave;o nhng d liu sau: T&ecirc;n Nike bt ngun t t&ecirc;n v thn chin thng ca Hy Lp, v&agrave; Swoosh ch&iacute;nh l&agrave; &ocirc;i c&aacute;nh ca v thn y. Tr&ecirc;n chin trng, &ocirc;i c&aacute;nh c tin l&agrave; mang n ng lc v&agrave; s liu lnh cho c&aacute;c chin binh; Ngo&agrave;i ra, t Swoosh trong ting Anh c&ograve;n c d&ugrave;ng  mi&ecirc;u t &acirc;m thanh ph&aacute;t ra ca mt vt lao i vi tc  cc nhanh. Kt hp h&igrave;nh nh v&agrave; &yacute; ngha y, Davidson &atilde; to ra Swoosh, logo ca Nike vi biu tng du phy nm ngang v&agrave; hng l&ecirc;n gi cm gi&aacute;c chuyn ng nhanh v&agrave; linh hot. V&ocirc; c&ugrave;ng ph&ugrave; hp vi thng hiu th thao. Mc d&ugrave; kh&ocirc;ng th&iacute;ch biu tng Swoosh n&agrave;y cho lm, nhng Knight &atilde; khng nh rng: &ldquo;Logo n&agrave;y s gi&uacute;p Nike ph&aacute;t trin.&rdquo;</p>\r\n\r\n<p style=\"text-align: center;\"><a href=\"https://advertisingvietnam.com/2019/03/cau-chuyen-ve-dau-swoosh-tren-logo-cua-nike/nikeswoosh-2/\" rel=\"attachment wp-att-33540\"><img alt=\"\" height=\"200\" sizes=\"(max-width: 721px) 100vw, 721px\" src=\"https://advertisingvietnam.com/wp-content/uploads/2019/03/nikeswoosh-2.jpg\" srcset=\"https://advertisingvietnam.com/wp-content/uploads/2019/03/nikeswoosh-2.jpg 680w, https://advertisingvietnam.com/wp-content/uploads/2019/03/nikeswoosh-2-300x83.jpg 300w\" width=\"721\" /></a></p>\r\n\r\n<p>L&uacute;c ban u,  kh&aacute;ch h&agrave;ng nhn din c Swoosh th&igrave; logo phi i k&egrave;m vi ch NIKE. Nhng cho n b&acirc;y gi th&igrave; vic &oacute; kh&ocirc;ng cn thit na. Bi biu tng Swoosh &atilde; in s&acirc;u v&agrave;o nhn thc ca kh&aacute;ch h&agrave;ng d&ugrave; l&agrave; mi hay c. Nike c&ugrave;ng Swoosh &atilde; ph&aacute;t trin v&ocirc; c&ugrave;ng mnh m. Trong sut 48 nm qua, lng logo c&oacute; th to n&ecirc;n  nhn din thng hiu nh Nike Swoosh ch l&agrave; mt con s &iacute;t i.</p>\r\n\r\n<p>n &acirc;y, ch&uacute;ng ta li x&eacute;t n mt vn  kh&aacute;c gia Swoosh v&agrave; Nike. C&acirc;u hi t ra: Swoosh l&agrave; yu t to n&ecirc;n th&agrave;nh c&ocirc;ng to ln cho Nike hay Swoosh ch &ldquo;hng k&eacute;&rdquo; s ni ting t Nike?&nbsp;Biu tng Swoosh to hiu qu qu&aacute; tt cho thng hiu Nike l&agrave; v&igrave; n&oacute; ch thng nhng gi&aacute; tr m&agrave; nh&atilde;n h&agrave;ng n&agrave;y nm bt (t&iacute;nh nng ng v&agrave; linh hot i vi mt sn phm thi trang th thao).</p>\r\n\r\n<p>David Aigrey, mt graphic designer v&agrave; l&agrave; chuy&ecirc;n gia nhn din thng hiu ni ting &atilde; d&agrave;nh tt c nhng li khen ngi cho t&aacute;c phm ca Davison. Anh cng nhc n iu quan trng l&agrave; kh&ocirc;ng  biu tng thng hiu b nhm ln vi ch&iacute;nh thng hiu. Nike c&oacute; th &atilde; chn mt biu tng ho&agrave;n to&agrave;n kh&aacute;c, v&agrave; cng s ph&aacute;t trin nh th. Logo mang &yacute; ngha ca i tng m&agrave; n&oacute; i din ch kh&ocirc;ng phi ngc li.&rdquo;</p>\r\n\r\n<p style=\"text-align: right;\">Ngc Tr&acirc;m / Advertising Vietnam</p>\r\n','2019-06-19 16:40:11','2019-06-23 09:16:48',4,2);
