INSERT INTO `products` VALUES (1,'Nike Air Zoom Pegasus 35 Men ',2700000,'The Nike Air Zoom Pegasus 35 is built for runners at every level, whether you\'re a seasoned veteran or just starting out. It features a breathable mesh upper with an out-turned collar for Achilles comfort. Down below, the cushioning has been updated with full-length Zoom Air for the first time ever, to deliver a smoother, more natural stride.\r\nColour Shown: Black/Gridiron/Peat Moss/Metallic Pewter\r\nStyle: 942851-013',1,'2019-06-15 16:04:35','2019-06-20 17:46:27',0,1,0,2),(2,'Nike Air Zoom Pegasus 35 Men',2300000,'The Nike Air Zoom Pegasus 35 is built for runners at every level, whether you\'re a seasoned veteran or just starting out. It features a breathable mesh upper with an out-turned collar for Achilles comfort. Down below, the cushioning has been updated with full-length Zoom Air for the first time ever, to deliver a smoother, more natural stride.\r\n\r\nColour Shown: Indigo Force/Photo Blue/Blue Void/White\r\nStyle: 942851-404',1,'2019-06-15 16:42:36','2019-06-20 17:12:53',0,1,0,2),(3,'Nike Legend React Men',2500000,'The Nike Legend React Men\'s Running Shoe features a breathable upper with synthetic overlays that enhance durability while smooth, responsive foam cushions every step as you run.\r\n\r\nColour Shown: Black/White\r\nStyle: AA1625-001',1,'2019-06-15 17:42:30','2019-06-22 12:57:30',0,1,0,2),(4,'Nike Legend React Men AA1625-601',2700000,'The Nike Legend React Men\'s Running Shoe features a breathable upper with synthetic overlays that enhance durability while smooth, responsive foam cushions every step as you run.\r\n\r\nColour Shown: University Red/Black/Amarillo/Hyper Grape\r\nStyle: AA1625-601',1,'2019-06-16 06:58:58','2019-06-20 17:12:53',0,1,0,2),(5,'Nike Legend React Men AA1625-407',2700000,'The Nike Legend React Men\'s Running Shoe features a breathable upper with synthetic overlays that enhance durability while smooth, responsive foam cushions every step as you run.\r\n\r\nColour Shown: Obsidian Mist/Bright Crimson/Phantom/Black\r\nStyle: AA1625-407',1,'2019-06-16 07:07:07','2019-06-26 10:34:35',0,1,0,2),(6,'Nike Legend React Men ( White/Game Royal)',2700000,'The Nike Legend React Men\'s Running Shoe features a breathable upper with synthetic overlays that enhance durability while smooth, responsive foam cushions every step as you run.\r\n\r\nColour Shown: White/Game Royal\r\nStyle: AA1625-101',1,'2019-06-16 07:12:20','2019-06-26 10:35:53',0,1,0,2),(7,'Nike Zoom Fly SP',4000000,'The Nike Zoom Fly SP is designed to meet the demands of your toughest tempo runs, long runs and race days. Responsive construction turns the pressure of each stride into energy return for the next. This special edition of the racer updates the lightweight support system, while design details inspired by the historic Breaking2 attempt adorn the shoe.\r\n\r\nColour Shown: Black/Summit White/Black\r\nStyle: AJ9282-003',1,'2019-06-16 08:04:51','2019-06-26 10:36:35',0,1,0,2),(8,'Jordan 89 Racer AQ3747-002',3000000,'With design details inspired by the Air Jordan 4, the Jordan 89 Racer delivers lightweight, breathable speed. A full-length foam midsole and textile in the upper mean you won\'t get weighed down when you need to get going.\r\n\r\nColour Shown: Particle Grey/Black/Sail/Gym Red\r\nStyle: AQ3747-002',1,'2019-06-16 08:16:51','2019-06-26 10:37:21',0,1,0,2),(9,'Jordan 89 Racer  AQ3747-101',3000000,'With design details inspired by the Air Jordan 4, the Jordan 89 Racer delivers lightweight, breathable speed. A full-length foam midsole and textile in the upper mean you won\'t get weighed down when you need to get going.\r\n\r\nColour Shown: White/University Gold/Blue Fury/Black\r\nStyle: AQ3747-101',1,'2019-06-16 08:23:15','2019-06-26 10:38:43',0,1,0,2),(10,'Nike Odyssey React Flyknit 2 Premium Women AV2608-146',3800000,'The Nike Odyssey React Flyknit 2 Premium combines artist Eva Magill-Oliver\'s meditative designs with a strategic combination of lightweight Flyknit and synthetic material for support just where you need it. Nike React cushioning delivers a soft, springy ride for a route that begs to be crushed.\r\n\r\nColour Shown: White/Hyper Pink/Blue Void\r\nStyle: AV2608-146',1,'2019-06-16 08:42:30','2019-06-20 17:12:54',0,1,1,2),(11,'Nike Odyssey React Flyknit 2 Premium  AV2608-001',3800000,'The Nike Odyssey React Flyknit 2 Premium combines artist Eva Magill-Oliver\'s meditative designs with a strategic combination of lightweight Flyknit and synthetic material for support just where you need it. Nike React cushioning delivers a soft, springy ride for a route that begs to be crushed.\r\n\r\nColour Shown: Metallic Silver/Sail/Black\r\nStyle: AV2608-001',1,'2019-06-16 09:08:50','2019-06-20 17:12:54',0,1,0,2),(12,'Nike Odyssey React Flyknit 2 Premium Women AV2608-001',3800000,'The Nike Odyssey React Flyknit 2 Premium combines artist Eva Magill-Oliver\'s meditative designs with a strategic combination of lightweight Flyknit and synthetic material for support just where you need it. Nike React cushioning delivers a soft, springy ride for a route that begs to be crushed.\r\n\r\nColour Shown: Metallic Silver/Sail/Black\r\nStyle: AV2608-001',1,'2019-06-16 09:11:46','2019-06-20 17:12:54',0,1,1,2),(13,'Nike Air Zoom Vomero 14 Women AH7858-005',4200000,'The Nike Air Zoom Vomero 14 takes responsive cushioning to the next level. The full-length Zoom Air unit works with Nike React cushioning to deliver a super-snappy, smooth ride. On the top, the sleek design is engineered to support your stride.\r\n\r\nColour Shown: Pure Platinum/Cool Grey/Lava Glow/Crimson Tint\r\nStyle: AH7858-005',1,'2019-06-16 09:20:54','2019-06-20 17:12:54',0,1,1,2),(14,'Nike Air Zoom Vomero 14 Women AH7858-301',4200000,'The Nike Air Zoom Vomero 14 takes responsive cushioning to the next level. The full-length Zoom Air unit works with Nike React cushioning to deliver a super-snappy, smooth ride. On the top, the sleek design is engineered to support your stride.\r\n\r\nColour Shown: Hyper Jade/Sail/Sapphire/Black\r\nStyle: AH7858-301',1,'2019-06-16 09:26:14','2019-06-20 17:12:54',0,1,1,2),(15,'Nike Air Zoom Vomero 14 Women AH7858-002',3000000,'The Nike Air Zoom Vomero 14 takes responsive cushioning to the next level. The full-length Zoom Air unit works with Nike React cushioning to deliver a super-snappy, smooth ride. On the top, the sleek design is engineered to support your stride.\r\n\r\nColour Shown: Vast Grey/Pink Foam/Lime Blast/Black\r\nStyle: AH7858-002',1,'2019-06-16 09:33:54','2019-06-20 17:12:54',0,1,1,2),(16,'Nike Epic Phantom React Flyknit BV1370-002',4000000,'The Nike Epic Phantom React Flyknit has a stretchy slip-on design to get you on your feet fast. Flyknit construction is lightweight and breathable, and Nike React cushioning feels soft and bouncy for comfort that outlasts your run.\r\n\r\nColour Shown: Black/University Red/Hyper Jade/Black\r\nStyle: BV1370-002',1,'2019-06-16 09:39:26','2019-06-20 17:12:54',0,1,2,2),(17,'Nike Free RN 5 boys AR4144',1800000,'The Nike Free RN 5.0 has lightweight, breathable material that stretches around your foot for a comfortable fit. Nike Free technology in the sole is super flexible and adjusts to your every step for all-day comfort.\r\n\r\nColour Shown: Summit White/Black/Blue Hero/Volt Glow\r\nStyle: AR4144-100',1,'2019-06-16 09:53:38','2019-06-20 17:12:54',0,1,2,2),(18,'Nike Epic React Flyknit 2 Girls AQ3243-003',3000000,'Step out in comfort in the Nike Epic React Flyknit 2. Flyknit construction hugs your foot with breathable support. Nike React technology provides a soft, responsive ride that\'s durable and lightweight.\r\n\r\nColour Shown: Black/Sapphire/Lime Blast/Black\r\nStyle: AQ3243-003',1,'2019-06-16 09:57:08','2019-06-20 17:12:54',0,1,3,2),(19,'Nike Epic React Flyknit 2 Girls  AQ3243-005',3000000,'Step out in comfort in the Nike Epic React Flyknit 2. Flyknit construction hugs your foot with breathable support. Nike React technology provides a soft, responsive ride that\'s durable and lightweight.\r\n\r\nColour Shown: Aviator Grey/Black/Blue Fury/Aviator Grey\r\nStyle: AQ3243-005',1,'2019-06-16 10:00:49','2019-06-20 17:12:54',0,1,3,2),(20,'ULTRABOOST 19 SHOES Men (Black)',3800000,'ULTRABOOST 19 SHOES\r\nSHOES WITH ENDLESS ENERGY FOR LONG CITY RUNS.\r\nRunning reinvented. These high-performance neutral running shoes deliver unrivaled comfort and energy return. The lightweight and propulsive shoes have a seamless knit upper that\'s engineered with motion weave technology to provide stretch while also holding your foot in place as you run. The second-skin fit follows the shape of your foot to reduce pressure points.',1,'2019-06-16 16:36:07','2019-06-20 17:12:54',0,2,0,2),(21,'ULTRABOOST 19 SHOES CLEAR BROWN / CHALK WHITE / CLOUD WHITE',3800000,'ULTRABOOST 19 SHOES\r\nSHOES WITH ENDLESS ENERGY FOR LONG CITY RUNS.\r\nRunning reinvented. These high-performance neutral running shoes deliver unrivaled comfort and energy return. The lightweight and propulsive shoes have a seamless knit upper that\'s engineered with motion weave technology to provide stretch while also holding your foot in place as you run. The second-skin fit follows the shape of your foot to reduce pressure points.',1,'2019-06-16 16:42:14','2019-06-20 17:12:54',0,2,0,2),(22,'ULTRABOOST 19 SHOES ICE MINT / ICE MINT / GREY SIX',3800000,'ULTRABOOST 19 SHOES\r\nSHOES WITH ENDLESS ENERGY FOR LONG CITY RUNS.\r\nRunning reinvented. These high-performance neutral running shoes deliver unrivaled comfort and energy return. The lightweight and propulsive shoes have a seamless knit upper that\'s engineered with motion weave technology to provide stretch while also holding your foot in place as you run. The second-skin fit follows the shape of your foot to reduce pressure points.',1,'2019-06-16 16:48:48','2019-06-20 17:12:54',0,2,0,2),(23,'PUREBOOST GO SHOES CORE BLACK / GREY / CARBON',2300000,'PUREBOOST GO SHOES\r\nADAPTIVE RUNNING SHOES MADE FOR CITY STREETS.\r\nBuilt to handle curbs, corners and uneven sidewalks, these natural running shoes have an expanded landing zone and a heel plate for added stability. A lightweight and stretchy knit upper supports your native stride. Energized cushioning works with the flexible outsole to give you a smooth and comfortable ride. \r\n\r\nEndless energy\r\nBoost is our most responsive cushioning ever, delivering incredible energy return: The more energy you give, the more you get\r\n\r\nNatural fit\r\nFitcounter molded heel counter provides a natural fit that allows optimal movement of the Achilles',1,'2019-06-16 16:51:46','2019-06-20 17:12:54',0,2,0,2),(24,'PUREBOOST GO SHOES CORE BLACK / SCARLET / CLEAR ORANGE',2300000,'PUREBOOST GO SHOES\r\nADAPTIVE RUNNING SHOES MADE FOR CITY STREETS.\r\nBuilt to handle curbs, corners and uneven sidewalks, these natural running shoes have an expanded landing zone and a heel plate for added stability. A lightweight and stretchy knit upper supports your native stride. Energized cushioning works with the flexible outsole to give you a smooth and comfortable ride. \r\n\r\nEndless energy\r\nBoost is our most responsive cushioning ever, delivering incredible energy return: The more energy you give, the more you get\r\n\r\nNatural fit\r\nFitcounter molded heel counter provides a natural fit that allows optimal movement of the Achilles',1,'2019-06-16 16:54:29','2019-06-20 17:12:54',0,2,0,2),(25,'PUREBOOST GO SHOES GREY / CORE BLACK / PALE NUDE',4700000,'PUREBOOST GO SHOES\r\nADAPTIVE RUNNING SHOES MADE FOR CITY STREETS.\r\nBuilt to handle curbs, corners and uneven sidewalks, these natural running shoes have an expanded landing zone and a heel plate for added stability. A lightweight and stretchy knit upper supports your native stride. Energized cushioning works with the flexible outsole to give you a smooth and comfortable ride. \r\n\r\nEndless energy\r\nBoost is our most responsive cushioning ever, delivering incredible energy return: The more energy you give, the more you get\r\n\r\nNatural fit\r\nFitcounter molded heel counter provides a natural fit that allows optimal movement of the Achilles',1,'2019-06-16 16:56:27','2019-06-20 17:12:54',0,2,0,2),(26,'PUREBOOST GO SHOES CLOUD WHITE / LIGHT SOLID GREY / CRYSTAL WHITE',2300000,'PUREBOOST GO SHOES\r\nADAPTIVE RUNNING SHOES MADE FOR CITY STREETS.\r\nBuilt to handle curbs, corners and uneven sidewalks, these natural running shoes have an expanded landing zone and a heel plate for added stability. A lightweight and stretchy knit upper supports your native stride. Energized cushioning works with the flexible outsole to give you a smooth and comfortable ride. \r\n\r\nEndless energy\r\nBoost is our most responsive cushioning ever, delivering incredible energy return: The more energy you give, the more you get\r\n\r\nNatural fit\r\nFitcounter molded heel counter provides a natural fit that allows optimal movement of the Achilles',1,'2019-06-16 16:58:18','2019-06-20 17:12:54',0,2,0,2),(27,'ULTRABOOST X MISSONI SHOES CORE BLACK / CLOUD WHITE / ACTIVE RED',5000000,'ULTRABOOST X MISSONI SHOES\r\nRESPONSIVE RUNNING SHOES CREATED IN COLLABORATION WITH MISSONI.\r\nBuilt for performance and comfort, these neutral running shoes give you the feeling of your best-ever run every time you lace them up. They have a lightweight knit upper that adapts to the changing shape of your foot as you run. Responsive cushioning works with the flexible outsole for a smooth and energized ride. ',1,'2019-06-16 17:00:29','2019-06-20 17:12:54',0,2,0,2),(28,'ULTRABOOST X MISSONI SHOES CLOUD WHITE / CLOUD WHITE / ACTIVE RED',5000000,'ULTRABOOST X MISSONI SHOES\r\nRESPONSIVE RUNNING SHOES CREATED IN COLLABORATION WITH MISSONI.\r\nBuilt for performance and comfort, these neutral running shoes give you the feeling of your best-ever run every time you lace them up. They have a lightweight knit upper that adapts to the changing shape of your foot as you run. Responsive cushioning works with the flexible outsole for a smooth and energized ride',1,'2019-06-16 17:04:02','2019-06-20 17:12:54',0,2,0,2),(29,'ASWEEGO SHOES CLOUD WHITE / CLOUD WHITE / CORE BLACK',1700000,'ASWEEGO SHOES\r\nRUNNING SHOES THAT FLEX FOR A SMOOTH, ADAPTABLE RIDE.\r\nShoes with flexibility and responsiveness for multisport training. These shoes have a knit textile upper that hugs the foot for a sock-like fit. Pillow-like midsole cushioning provides long-lasting comfort. Durable rubber inserts at the forefoot and heel provide added grip so you\'re ready for unexpected terrain.',1,'2019-06-16 17:07:42','2019-06-20 17:12:54',0,2,0,2),(30,'ULTRABOOST 19 PRIDE SHOES COLOR: RUNNING WHITE / SCARLET / BRIGHT YELLOW',3800000,'ULTRABOOST 19 PRIDE SHOES\r\nCelebrate the beauty in diversity. These running shoes have a seamless, stretchy knit upper that adapts to the shape of your foot as you move. A flexible outsole works with dual-density cushioning for endless energy and a smooth stride',1,'2019-06-16 17:13:32','2019-06-20 17:12:54',0,2,1,2),(31,'ULTRABOOST 19 SHOES CORE BLACK / GREY SIX / GREY FOUR',3800000,'ULTRABOOST 19 SHOES\r\nSHOES WITH ENDLESS ENERGY TO REINVENT YOUR RUNNING EXPERIENCE.\r\nRunning reinvented. These high-performance neutral running shoes deliver unrivaled comfort and energy return. The lightweight and propulsive shoes have a seamless knit upper that\'s engineered with motion weave technology to provide stretch while also holding your foot in place while you run. The second-skin fit follows the shape of your foot to reduce pressure points.',1,'2019-06-16 17:15:35','2019-06-20 17:12:54',0,2,1,2),(33,'SOLAR GLIDE SHOES RAW WHITE / ACTIVE BLUE / SHOCK RED',2200000,'ULTRABOOST X MISSONI SHOES\r\nRESPONSIVE RUNNING SHOES CREATED IN COLLABORATION WITH MISSONI.\r\nBuilt for performance and comfort, these neutral running shoes give you the feeling of your best-ever run every time you lace them up. They have a lightweight knit upper that adapts to the changing shape of your foot as you run. Responsive cushioning works with the flexible outsole for a smooth and energized ride. ',1,'2019-06-16 17:20:53','2019-06-20 17:12:54',0,2,1,2),(34,'ULTRABOOST LACELESS SHOES COLOR: CLOUD WHITE / CLOUD WHITE / ACTIVE GREEN',4000000,'ULTRABOOST LACELESS SHOES\r\nLACE-FREE SHOES FOR ENERGIZED CITY RUNNING.\r\nThese neutral running shoes were designed using motion capture technology to deliver an unrestricted feel. The laceless shoes have a stretchy knit upper that hugs the foot. A forged band at the midfoot provides a supportive fit. Responsive cushioning and a flexible outsole give you a smooth ride. \r\n\r\nEngineered fit\r\nadidas Primeknit upper wraps the foot with an engineered fit for targeted support that enhances movement\r\n\r\nEndless energy\r\nBoost is our most responsive cushioning ever, delivering incredible energy return: The more energy you give, the more you get',1,'2019-06-16 17:23:35','2019-06-20 17:12:54',0,2,1,2),(35,'RAPIDARUN SHOES COLOR: ECRU TINT / GLOW PINK / ECRU TINT',1650000,'RAPIDARUN SHOES\r\nLACELESS RUNNING SHOES WITH A STANDOUT LOOK.\r\nGet ahead of the pack in these juniors\' slip-on running shoes. They\'re built with a multicolor knit textile upper that provides an adaptive fit and a standout look. A cushy midsole keeps your feet comfortable while a TPU heel clip offers ultimate stability.',1,'2019-06-16 17:26:54','2019-06-20 17:12:54',0,2,2,2),(36,'U_PATH RUN SHOES CLOUD WHITE / CLOUD WHITE / CLOUD WHITE',1200000,'U_PATH RUN SHOES\r\nMESH RUNNING-STYLE SHOES WITH A D-RING LACING SYSTEM.\r\nThe U_Path offers a sleek combination of retro and modern. These juniors\' shoes are built of soft, breathable mesh for everyday wear. The unique D-ring lacing system is inspired by a \'70s running sneaker design. A bungee heel piece adds support, and a lightweight EVA midsole provides all-day wearability.',1,'2019-06-16 17:35:38','2019-06-20 17:12:54',0,2,3,2),(37,'BASELINE SHOES CLOUD WHITE / CORE BLACK / CLOUD WHITE',1000000,'BASELINE SHOES\r\nStyle\'s starting point. These casual kids\' shoes are made with a suede upper and have simple lines for premium understated style.',1,'2019-06-16 17:37:10','2019-06-20 17:12:54',0,2,3,2),(38,'RAPIDARUN WIDE SHOES CORE BLACK / CARBON / SOLAR RED',1250000,'RAPIDARUN WIDE SHOES\r\nRUNNING SHOES WITH EXTRA ROOM WHERE YOU NEED IT.\r\nGet ready to race around the park, gym or track in these juniors\' running shoes. They\'re made of a breathable mesh upper with overlays for protection. A TPU heel clip gives you extra stability, and a cushy midsole keeps your feet comfortable all day. A wide fit provides additional room where you need it most.',1,'2019-06-16 17:38:53','2019-06-20 17:12:54',0,2,2,2),(39,'ERA COLOR-BLACK',1000000,'The Era, Vans classic low top lace-up skate shoe, has a durable double-stitched canvas upper with padded tongue and lining and Vans signature Waffle Outsole.',3,'2019-06-16 17:47:33','2019-06-19 17:59:20',0,9,0,2),(40,'OLD SKOOL BLACK/WHITE',1200000,'The Old Skool, Vans classic skate shoe and the first to bear the iconic side stripe, has a low-top lace-up silhouette with a durable suede and canvas upper with padded tongue and lining and Vans signature Waffle Outsole.',3,'2019-06-16 17:52:02','2019-06-19 17:59:32',0,9,0,2),(41,'SLIP-ON COLOR-TRUE WHITE',1000000,'The Classic Slip-On has a low profile, slip-on canvas upper with all-over checker print, elastic side accents, Vans flag label and Vans original Waffle Outsole.',3,'2019-06-16 17:58:12','2019-06-19 17:59:44',0,9,0,2),(42,'CHECKERBOARD SLIP-ON  COLOR-TRUE WHITE/TRUE WHITE',1000000,'The Checkerboard Classic Slip-On features sturdy low profile slip-on canvas uppers with the iconic Vans checkerboard print, padded collars, elastic side accents, and signature rubber waffle outsoles.',3,'2019-06-16 18:01:17','2019-06-19 17:59:55',0,9,0,2),(43,'OLD SKOOL Women COLOR-BLACK/WHITE',1200000,'The Old Skool, Vans classic skate shoe and the first to bear the iconic side stripe, has a low-top lace-up silhouette with a durable suede and canvas upper with padded tongue and lining and Vans signature Waffle Outsole.',3,'2019-06-16 18:05:37','2019-06-19 18:00:07',0,9,1,2),(44,'PLAID ERA Women COLOR-WHITE/TRUE WHITE',1200000,'The Plaid Era combines the Vans classic low top skate shoe with sturdy textile uppers, metal eyelets, padded collars for support and flexibility, and signature rubber waffle outsoles.',3,'2019-06-16 18:08:48','2019-06-19 18:00:19',0,9,1,2),(45,'VANS X HARRY POTTER SK8-HI ZIP COLOR-GRYFFINDOR/MULTI',1000000,'This season, Vans and HARRY POTTER have conjured up a magical collection for witches, wizards, and muggles alike. Featuring sturdy canvas and suede uppers, the Vans x HARRY POTTER Sk8-Hi Zip also includes padded collars for support and flexibility, signature rubber waffle outsoles, custom collaboration details, and a zipper entry at the heel.  Display your GRYFFINDOR loyalty in genuine Off The Wall style.',3,'2019-06-16 18:12:24','2019-06-19 18:00:31',0,9,2,2),(47,'KIDS CHECKERBOARD OLD SKOOL COLOR-RAINBOW/TRUE WHITE',850000,'The Checkerboard Old Skool, the Vans classic skate shoe and first to bare the iconic sidestripe, is a low top lace-up featuring sturdy suede and canvas uppers with the iconic Vans checkerboard print, re-enforced toecaps to withstand repeated wear, padded collars for support and flexibility, and signature rubber waffle outsoles.\r\n\r\nEach season we offer a range of shoes, apparel and accessories styled with rainbow motifs to enable our global consumers the ability to express their own individuality and creative expression. To celebrate Pride Month 2019, Vans is donating $50,000 to The Trevor Project, the worlds largest suicide prevention and crisis intervention organization for LGBTQ (lesbian, gay, bisexual, transgender, queer and questioning) young people.',3,'2019-06-16 18:20:37','2019-06-19 18:01:05',0,9,3,2),(48,'Chuck Taylor All Star Low Top Optical White',1000000,'WE MAKE THE SHOE. YOU MAKE THE STORIES.\r\nIt started when we took scissors to our original High Top Chucks, turning them into low top basketball shoes. Then the sneaker escaped the court for the streets, cementing its status as an everyday icon. Whats next for the Low Top Chucks is up to you. Theyre versatile, classic and entirely yours to wear any way you want, anywhere you want, anytime you want. We just make the shoe. You make the stories.',3,'2019-06-16 18:29:36','2019-06-19 18:02:14',0,8,0,2),(49,'Chuck Taylor All Star Low Top',1000000,'WE MAKE THE SHOE. YOU MAKE THE STORIES.\r\nIt started when we took scissors to our original High Top Chucks, turning them into low top basketball shoes. Then the sneaker escaped the court for the streets, cementing its status as an everyday icon. Whats next for the Low Top Chucks is up to you. Theyre versatile, classic and entirely yours to wear any way you want, anywhere you want, anytime you want. We just make the shoe. You make the stories.',3,'2019-06-16 18:33:53','2019-06-19 18:02:24',0,8,0,2),(50,'Chuck Taylor All Star High Top Black',1150000,'WE MAKE THE SHOE. YOU MAKE THE STORIES.\r\nWe could tell you that its the OG basketball shoe, created over 100 years ago. Or that the design has largely stayed the same, because why mess with a good thing. Or how it became the unofficial sneaker of all your favorite artists and musicians, who each made it their own. Yeah, we could share a lot of stories, but the one that matters most isnt oursits yours. Its how and where you take your Chucks. The legacy is long, but what comes next is up to you. We just make the shoe. You make the stories.',3,'2019-06-16 18:37:50','2019-06-19 18:02:42',0,8,1,2),(51,'Chuck Taylor All Star High Top Pink',1150000,'WE MAKE THE SHOE. YOU MAKE THE STORIES.\r\nWe could tell you that its the OG basketball shoe, created over 100 years ago. Or that the design has largely stayed the same, because why mess with a good thing. Or how it became the unofficial sneaker of all your favorite artists and musicians, who each made it their own. Yeah, we could share a lot of stories, but the one that matters most isnt oursits yours. Its how and where you take your Chucks. The legacy is long, but what comes next is up to you. We just make the shoe. You make the stories.',3,'2019-06-16 18:41:17','2019-06-19 18:02:54',0,8,1,2),(52,'Nike Air VaporMax Flyknit 3 AJ6900-006 ',3900000,'The Nike Air VaporMax Flyknit 3 features flowing, 2-tone lines of breathable, stretchable Flyknit construction for unique, street-ready style. Revolutionary VaporMax Air technology keeps spring in your step with toe-to-heel cushioning.\r\n\r\nShown: Black/Volt/Blue Lagoon/Black\r\nStyle: AJ6900-006',2,'2019-06-17 09:58:48','2019-06-19 18:03:09',0,5,0,2),(53,'Nike Air VaporMax Flyknit 3 AJ6900-001',3950000,'The Nike Air VaporMax Flyknit 3 features flowing, 2-tone lines of breathable, stretchable Flyknit construction for unique, street-ready style. Revolutionary VaporMax Air technology keeps spring in your step with toe-to-heel cushioning.\r\n\r\nShown: Atmosphere Grey/Pure Platinum/Hyper Crimson/Reflect Silver\r\nStyle: AJ6900-001',2,'2019-06-17 10:05:25','2019-06-19 18:03:19',0,5,0,2),(54,'Nike Air Max 90 QS CD0916-100',2910000,'Originally designed by Tinker Hatfield in 1990, the Air Max 90 has been re-imagined. Widely considered one of the biggest cross-cultural icons of the early \'00s, this iteration pays tribute to the influential 2003 \"Snakeskin\" release with premium materials and a bold twist on the original.\r\n\r\nShown: White/Anthracite/Light Graphite/Medium Grey\r\nStyle: CD0916-100',2,'2019-06-17 10:08:07','2019-06-19 18:03:40',0,5,0,2),(55,'Nike Air Max 90 QS CD0916-001 ',2950000,'Originally designed by Tinker Hatfield in 1990, the Air Max 90 has been re-imagined. Widely considered one of the biggest cross-cultural icons of the early \'00s, this iteration pays tribute to the influential 2003 \"Snakeskin\" release with premium materials and a bold twist on the original.\r\n\r\nShown: Black/Cyber/Fir/Black\r\nStyle: CD0916-001',2,'2019-06-17 10:11:43','2019-06-26 10:41:00',0,5,0,2),(56,'Nike React Presto  CD9015-700',2400000,'Taking a cue from the early 2000s original, the Nike React Presto plays up its past with a cast of characters for your feet. A stretchy sleeve and foam midsole deliver a relaxed sensation for all-day comfort, while numerous lacing options let you customize your look.\r\n\r\nShown: Barely Volt/Blue Gaze/Volt/Hyper Crimson\r\nStyle: CD9015-700',2,'2019-06-17 10:16:44','2019-06-26 10:42:02',0,5,1,2),(57,'Nike React Presto  CD9015-101',2950000,'Taking a cue from the early 2000s original, the Nike React Presto plays up its past with a cast of characters for your feet. A stretchy sleeve and foam midsole deliver a relaxed sensation for all-day comfort, while numerous lacing options let you customize your look.\r\nShown: White/Luminous Green/Bleached Coral/Hyper Violet\r\nStyle: CD9015-101',2,'2019-06-17 10:18:49','2019-06-26 10:42:54',0,5,1,2),(58,'Nike Air Max Dia LX  CI1214-302',2400000,'Designed specifically for a woman\'s foot, the Nike Air Max Dia LX delivers a lifted and airy aesthetic in a new, sleek shape. The minimal upper modernizes your look, while the Max Air unit, surrounded by clear plastic, elevates your style.\r\n\r\nShown: Luminous Green/Summit White/Phantom\r\nStyle: CI1214-302',2,'2019-06-17 10:21:07','2019-06-26 10:43:32',0,5,1,2),(59,'Nike Air Max Dia  AQ4312-103',2400000,'The Nike Air Max Dia delivers a lifted look and airy aesthetic in a sleek shape. The minimal upper modernizes the look, while a Max Air unit, surrounded by clear TPU, is amplified even further by an exaggerated midsole for a boost of style.\r\n\r\nShown: Light Orewood Brown/Summit White/Teal Tint\r\nStyle: AQ4312-103',2,'2019-06-17 10:22:58','2019-06-26 10:44:12',0,5,1,2),(60,'NMD_R1 SHOES CLOUD WHITE / CLOUD WHITE / CRYSTAL WHITE',2750000,'NMD_R1 SHOES\r\nA MODERN NMD SNEAKER WITH A SNUG, SUPPORTIVE KNIT UPPER.\r\nStreamlined and modern, these NMD shoes combine \'80s racing heritage with style cues taken from outdoor trail gear. The foot-hugging knit upper rides on a responsive cushioned midsole. ',2,'2019-06-17 10:26:30','2019-06-26 10:45:07',0,6,0,2),(61,'NMD_R1 SHOES LINEN GREEN / LINEN GREEN / ICE MINT',2850000,'NMD_R1 SHOES\r\nA MODERN NMD SNEAKER WITH A SNUG, SUPPORTIVE KNIT UPPER.\r\nStreamlined and modern, these NMD shoes combine \'80s racing heritage with style cues taken from outdoor trail gear. The foot-hugging knit upper rides on a responsive cushioned midsole. ',2,'2019-06-17 10:27:44','2019-06-23 08:50:27',0,6,0,2),(62,'CONTINENTAL 80 SHOES ',1850000,'CONTINENTAL 80 SHOES\r\nCOURT-INSPIRED SNEAKERS WITH RETRO CHARM.\r\nThe Continental 80 is an authentic bringback of an indoor sneaker from the \'80s. These low-top sneakers are made of smooth leather. They show off a swooping two-tone stripe on the side and a split rubber cupsole.',2,'2019-06-17 10:30:25','2019-06-26 10:51:40',0,6,0,2),(63,'CONTINENTAL 80 SHOES  CLOUD WHITE / CLOUD WHITE / GREY ONE',1100000,'CONTINENTAL 80 SHOES\r\nCOURT-INSPIRED SNEAKERS WITH RETRO CHARM.\r\nThe Continental 80 is an authentic bringback of an indoor sneaker from the \'80s. These low-top sneakers are made of smooth leather. They show off a swooping two-tone stripe on the side and a split rubber cupsole.',2,'2019-06-17 10:35:18','2019-06-26 10:50:00',0,6,0,2),(64,'FALCON SHOES  CLOUD WHITE / CLOUD WHITE / CRYSTAL WHITE',2000000,'FALCON SHOES\r\nSTREETWEAR SHOES WITH A \'90S RETRO RUNNING STYLE VIBE.\r\nThe Falcon takes inspiration from \'90s running designs and the carefree, rebellious spirit of that decade\'s art, music and fashion. These shoes offer a distinctly \'90s look with vibrant colors and a wide, chunky silhouette. They feature a mesh upper and show off a big midsole that\'s built for comfortable all-day wear.',2,'2019-06-17 10:37:31','2019-06-26 10:50:54',0,6,1,2),(65,'FALCON SHOES  CLOUD GREY TWO / GREY TWO / RAW GREY',1925000,'FALCON SHOES\r\nSTREETWEAR SHOES WITH A \'